import httpClient from "@/utils/httpclient";
export default {
  name: "shopManager",
  data: function data() {
    return {
      tableFields: {
        phone: {
          label: this.$t('m.common.phone'),
          class: "text-center"
        },
        idcard: {
          label: this.$t('m.cloud.id_card'),
          class: "text-center"
        },
        driveCheck: {
          label: this.$t('m.cloud.drive_check'),
          class: "text-center"
        },
        statusCheck: {
          label: this.$t('m.cloud.verify_status'),
          class: "text-center"
        },
        // point: {
        //     label: this.$t('m.cloud.appoint'),
        //     class: "text-center"
        // },
        dealership: {
          label: this.$t('m.common.dealership'),
          class: "text-center"
        },
        actions: {
          label: this.$t('m.vehicle.actions'),
          class: "Actions"
        }
      },
      table: null,
      currentPage: 1,
      pageSize: 10,
      total: 0,
      totalPages: 0,
      showTip: false,
      curName: '',
      curAdminList: []
    };
  },
  mounted: function mounted() {
    this.initData(this.currentPage, this.pageSize);
  },
  methods: {
    initData: function initData(page) {
      var _this = this;

      httpClient.get("/api/v1/clouddrive/user/list?pageNo=".concat(page, "&pageSize=").concat(this.pageSize)).then(function (response) {
        _this.total = response.data.data.rowCount;

        _this.filterData(response.data.data);

        _this.pageCount = response.data.data.totalPages;
      });
    },
    filterData: function filterData(data) {
      this.table = data.datas.map(function (item) {
        return {
          phone: item.phone,
          idcardAuthStatus: item.idcardAuthStatus,
          driverAuthStatus: item.driverAuthStatus,
          checkStatus: item.checkStatus,
          dealership: item.tenantName,
          point: item.appointmentStatus,
          userId: item.userId
        };
      });
    },
    prevPage: function prevPage() {
      this.initData(this.currentPage > 1 ? this.currentPage - 1 : 1);
    },
    nextPage: function nextPage() {
      this.initData(this.currentPage >= this.pageCount ? this.currentPage : this.currentPage + 1);
    },
    changePage: function changePage(page) {
      this.initData(page);
    }
  }
};
